import React from 'react'
import { mdx } from '@mdx-js/react'

/* @jsxRuntime classic */
/* @jsx mdx */
import { Playground, Props } from 'docz';
import 'antd/dist/antd.css';
import SearchForm from './SearchForm';
import  { Component, ReactNode } from 'react';
import { Input, Modal } from 'antd';


const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h1 {...{
      "id": "搜索表单"
    }}>{`搜索表单`}</h1>
    <p>{`搜索表单为你处理了`}</p>
    <ul>
      <li parentName="ul">{`元素对齐的处理方法`}</li>
      <li parentName="ul">{`搜索，重置按钮及点击按钮时触发 onSubmit 事件`}</li>
    </ul>
    <p>{`传入表单项，和提交时执行的方法即可`}</p>
    <h2 {...{
      "id": "示例"
    }}>{`示例`}</h2>
    <h3 {...{
      "id": "基本用法"
    }}>{`基本用法`}</h3>
    <p>{`表单项<=3个时，使用内联布局；>3个时，默认一行排3项`}</p>
    <Playground __position={0} __code={'<h2>小于等于3项</h2>\n<SearchForm\n  itemList={[\n    {\n      label: \'参数1\',\n      content: <Input />,\n      name: \'name\',\n    },\n    {\n      label: \'参数2\',\n      content: <Input />,\n      name: \'name2\',\n    },\n    {\n      label: \'参数3\',\n      content: <Input />,\n      name: \'name3\',\n    },\n  ]}\n  onSubmit={values => {\n    Modal.confirm({\n      content: JSON.stringify(values),\n    })\n  }}\n/>\n<h2>大于3项，一行3列，并自动处理对齐</h2>\n<SearchForm\n  itemList={[\n    {\n      label: \'参数1\',\n      content: <Input />,\n      name: \'name\',\n    },\n    {\n      label: \'参数2\',\n      content: <Input />,\n      name: \'name2\',\n    },\n    {\n      label: \'参数3\',\n      content: <Input />,\n      name: \'name3\',\n    },\n    {\n      label: \'参数4\',\n      content: <Input />,\n      name: \'name4\',\n    },\n  ]}\n  onSubmit={values => {\n    Modal.confirm({\n      content: JSON.stringify(values),\n    })\n  }}\n/>'} __scope={{
      props: this ? this.props : props,
      Playground,
      Props,
      SearchForm,
      Component,
      ReactNode,
      Input,
      Modal
    }} __codesandbox={`undefined`} mdxType="Playground">
  <h2>小于等于3项</h2>
  <SearchForm itemList={[{
        label: '参数1',
        content: <Input mdxType="Input" />,
        name: 'name'
      }, {
        label: '参数2',
        content: <Input mdxType="Input" />,
        name: 'name2'
      }, {
        label: '参数3',
        content: <Input mdxType="Input" />,
        name: 'name3'
      }]} onSubmit={values => {
        Modal.confirm({
          content: JSON.stringify(values)
        });
      }} mdxType="SearchForm" />
  <h2>大于3项，一行3列，并自动处理对齐</h2>
  <SearchForm itemList={[{
        label: '参数1',
        content: <Input mdxType="Input" />,
        name: 'name'
      }, {
        label: '参数2',
        content: <Input mdxType="Input" />,
        name: 'name2'
      }, {
        label: '参数3',
        content: <Input mdxType="Input" />,
        name: 'name3'
      }, {
        label: '参数4',
        content: <Input mdxType="Input" />,
        name: 'name4'
      }]} onSubmit={values => {
        Modal.confirm({
          content: JSON.stringify(values)
        });
      }} mdxType="SearchForm" />
    </Playground>
    <h2 {...{
      "id": "表单项联动"
    }}>{`表单项联动`}</h2>
    <p>{`第一个输入框输入数字时，参数2的值 = 参数1的值 + 10`}</p>
    <Playground __position={1} __code={'class Demo extends React.Component {\n    render() {\n      return (\n        <SearchForm\n          itemList={[\n            {\n              label: \'参数1\',\n              content: (\n                <Input\n                  onChange={event => {\n                    if (this.form) {\n                      const value = Number(event.target.value)\n                      this.form.setFieldsValue({\n                        name2: value ? value * 10 : \'\',\n                      })\n                    }\n                  }}\n                />\n              ),\n              name: \'name\',\n            },\n            {\n              label: \'参数2\',\n              content: <Input />,\n              name: \'name2\',\n            },\n          ]}\n          getFormInstance={form => {\n            this.form = form\n          }}\n          onSubmit={values => {\n            Modal.confirm({\n              content: JSON.stringify(values),\n            })\n          }}\n        />\n      )\n    }\n  }'} __scope={{
      props: this ? this.props : props,
      Playground,
      Props,
      SearchForm,
      Component,
      ReactNode,
      Input,
      Modal
    }} __codesandbox={`undefined`} mdxType="Playground">
      {class Demo extends React.Component {
        render() {
          return <SearchForm itemList={[{
            label: '参数1',
            content: <Input onChange={event => {
              if (this.form) {
                const value = Number(event.target.value);
                this.form.setFieldsValue({
                  'name2': value ? value * 10 : ''
                });
              }
            }} mdxType="Input" />,
            name: 'name'
          }, {
            label: '参数2',
            content: <Input mdxType="Input" />,
            name: 'name2'
          }]} getFormInstance={form => {
            this.form = form;
          }} onSubmit={values => {
            Modal.confirm({
              content: JSON.stringify(values)
            });
          }} mdxType="SearchForm" />;
        }

      }}
    </Playground>
    <h2 {...{
      "id": "显式设置列数"
    }}>{`显式设置列数`}</h2>
    <p>{`设置为一行2列`}</p>
    <Playground __position={2} __code={'<SearchForm\n  columnNumber={2}\n  itemList={[\n    {\n      label: \'参数1\',\n      content: <Input />,\n      name: \'name\',\n    },\n    {\n      label: \'参数2\',\n      content: <Input />,\n      name: \'name2\',\n    },\n    {\n      label: \'参数3\',\n      content: <Input />,\n      name: \'name3\',\n    },\n    {\n      label: \'参数4\',\n      content: <Input />,\n      name: \'name4\',\n    },\n  ]}\n  onSubmit={values => {\n    Modal.confirm({\n      content: JSON.stringify(values),\n    })\n  }}\n/>'} __scope={{
      props: this ? this.props : props,
      Playground,
      Props,
      SearchForm,
      Component,
      ReactNode,
      Input,
      Modal
    }} __codesandbox={`undefined`} mdxType="Playground">
  <SearchForm columnNumber={2} itemList={[{
        label: '参数1',
        content: <Input mdxType="Input" />,
        name: 'name'
      }, {
        label: '参数2',
        content: <Input mdxType="Input" />,
        name: 'name2'
      }, {
        label: '参数3',
        content: <Input mdxType="Input" />,
        name: 'name3'
      }, {
        label: '参数4',
        content: <Input mdxType="Input" />,
        name: 'name4'
      }]} onSubmit={values => {
        Modal.confirm({
          content: JSON.stringify(values)
        });
      }} mdxType="SearchForm" />
    </Playground>
    <h2 {...{
      "id": "设置表单项小于等于5时默认为3），使用内联"
    }}>{`设置表单项小于等于5时(默认为3），使用内联`}</h2>
    <Playground __position={3} __code={'<SearchForm\n  inlineMaxNumber={4}\n  itemList={[\n    {\n      label: \'参数1\',\n      content: <Input />,\n      name: \'name\',\n    },\n    {\n      label: \'参数2\',\n      content: <Input />,\n      name: \'name2\',\n    },\n    {\n      label: \'参数3\',\n      content: <Input />,\n      name: \'name3\',\n    },\n    {\n      label: \'参数4\',\n      content: <Input />,\n      name: \'name4\',\n    },\n  ]}\n  onSubmit={values => {\n    Modal.confirm({\n      content: JSON.stringify(values),\n    })\n  }}\n/>'} __scope={{
      props: this ? this.props : props,
      Playground,
      Props,
      SearchForm,
      Component,
      ReactNode,
      Input,
      Modal
    }} __codesandbox={`undefined`} mdxType="Playground">
  <SearchForm inlineMaxNumber={4} itemList={[{
        label: '参数1',
        content: <Input mdxType="Input" />,
        name: 'name'
      }, {
        label: '参数2',
        content: <Input mdxType="Input" />,
        name: 'name2'
      }, {
        label: '参数3',
        content: <Input mdxType="Input" />,
        name: 'name3'
      }, {
        label: '参数4',
        content: <Input mdxType="Input" />,
        name: 'name4'
      }]} onSubmit={values => {
        Modal.confirm({
          content: JSON.stringify(values)
        });
      }} mdxType="SearchForm" />
    </Playground>
    <h2 {...{
      "id": "自定义搜索、重置元素的外观"
    }}>{`自定义搜索、重置元素的外观`}</h2>
    <Playground __position={4} __code={'<SearchForm\n  renderSearchElement={() => {\n    return <a>我是自定义的搜索</a>\n  }}\n  renderResetElement={() => {\n    return <a>我是自定义的重置</a>\n  }}\n  itemList={[\n    {\n      label: \'参数1\',\n      content: <Input />,\n      name: \'name\',\n    },\n    {\n      label: \'参数2\',\n      content: <Input />,\n      name: \'name2\',\n    },\n  ]}\n  onSubmit={values => {\n    Modal.confirm({\n      content: JSON.stringify(values),\n    })\n  }}\n/>'} __scope={{
      props: this ? this.props : props,
      Playground,
      Props,
      SearchForm,
      Component,
      ReactNode,
      Input,
      Modal
    }} __codesandbox={`undefined`} mdxType="Playground">
  <SearchForm renderSearchElement={() => {
        return <a>我是自定义的搜索</a>;
      }} renderResetElement={() => {
        return <a>我是自定义的重置</a>;
      }} itemList={[{
        label: '参数1',
        content: <Input mdxType="Input" />,
        name: 'name'
      }, {
        label: '参数2',
        content: <Input mdxType="Input" />,
        name: 'name2'
      }]} onSubmit={values => {
        Modal.confirm({
          content: JSON.stringify(values)
        });
      }} mdxType="SearchForm" />
    </Playground>
    <h2 {...{
      "id": "设置初始值"
    }}>{`设置初始值`}</h2>
    <Playground __position={5} __code={'<SearchForm\n  renderSearchElement={() => {\n    return <a>我是自定义的搜索</a>\n  }}\n  renderResetElement={() => {\n    return <a>我是自定义的重置</a>\n  }}\n  initialValues={{\n    name: \'小王\',\n  }}\n  itemList={[\n    {\n      label: \'参数1\',\n      content: <Input />,\n      name: \'name\',\n    },\n    {\n      label: \'参数2\',\n      content: <Input />,\n      name: \'name2\',\n    },\n  ]}\n  onSubmit={values => {\n    Modal.confirm({\n      content: JSON.stringify(values),\n    })\n  }}\n/>'} __scope={{
      props: this ? this.props : props,
      Playground,
      Props,
      SearchForm,
      Component,
      ReactNode,
      Input,
      Modal
    }} __codesandbox={`undefined`} mdxType="Playground">
  <SearchForm renderSearchElement={() => {
        return <a>我是自定义的搜索</a>;
      }} renderResetElement={() => {
        return <a>我是自定义的重置</a>;
      }} initialValues={{
        name: '小王'
      }} itemList={[{
        label: '参数1',
        content: <Input mdxType="Input" />,
        name: 'name'
      }, {
        label: '参数2',
        content: <Input mdxType="Input" />,
        name: 'name2'
      }]} onSubmit={values => {
        Modal.confirm({
          content: JSON.stringify(values)
        });
      }} mdxType="SearchForm" />
    </Playground>
    <h2 {...{
      "id": "禁用"
    }}>{`禁用`}</h2>
    <Playground __position={6} __code={'<SearchForm\n  disabled\n  itemList={[\n    {\n      label: \'参数1\',\n      content: <Input />,\n      name: \'name\',\n    },\n    {\n      label: \'参数2\',\n      content: <Input />,\n      name: \'name2\',\n    },\n  ]}\n  onSubmit={values => {\n    Modal.confirm({\n      content: JSON.stringify(values),\n    })\n  }}\n/>'} __scope={{
      props: this ? this.props : props,
      Playground,
      Props,
      SearchForm,
      Component,
      ReactNode,
      Input,
      Modal
    }} __codesandbox={`undefined`} mdxType="Playground">
  <SearchForm disabled itemList={[{
        label: '参数1',
        content: <Input mdxType="Input" />,
        name: 'name'
      }, {
        label: '参数2',
        content: <Input mdxType="Input" />,
        name: 'name2'
      }]} onSubmit={values => {
        Modal.confirm({
          content: JSON.stringify(values)
        });
      }} mdxType="SearchForm" />
    </Playground>
    <h2 {...{
      "id": "属性"
    }}>{`属性`}</h2>
    <Props of={SearchForm} mdxType="Props" />
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
